import React, { useState } from 'react'

const Calculate = () => {
    const [num, setNum] = useState(0);

    const increment=()=>{

        setNum((prevCount)=>{
            return prevCount+1;
        })
    }

    const decrement=()=>{
        setNum((prevCount)=>{
            return prevCount-1;
        })
    }

    



    return (
   <>
       <button onClick={increment}>increment</button>
       <span>{num}</span>
       <button onClick={decrement}>decrement</button>
   </>
  )
}

export default Calculate
